import React from "react";

const LandingPage = () => (
  <div>
    <h1>I command computers to perform tasks.</h1>

    <p>This page is public, accessible by everyone</p>

    <p className="split">
    Hello there, my name is Kaye. I am an experienced <em><strong>multimedia designer</strong></em> with all sorts of other experiences under my belt. As an upcoming Software Engineering student, I could not be more thrilled about studying algorithms, cryptocurrency, and technologies of the future. I love to cultivate a growth mindset, who else would I rather be?
    </p>
  </div>
);

export default LandingPage;
